package me.ix.noskillv2.utils.webserver;

import java.io.BufferedReader;
import java.io.InputStreamReader;
import java.io.OutputStream;
import java.net.ServerSocket;
import java.net.Socket;

import me.ix.noskillv2.CommandManager;
import me.ix.noskillv2.NoSkillv2;
import me.ix.noskillv2.utils.Utils;
import net.dv8tion.jda.api.sharding.ShardManager;

public class WebServer extends Thread {

	private int port;
	private CommandManager mgr;
	ShardManager shardManager;
	
	long time = System.currentTimeMillis() / 1000L;
	
	public WebServer(int port, CommandManager mgr, ShardManager shardManager) {
		this.port = port;
		this.mgr = mgr;
		this.shardManager = shardManager;
	}
	
	public String getBase64Logo() {
		return "data:image/png;base64,";
	}
	
	public String getUptimeText() {
		long timeNow = System.currentTimeMillis() / 1000L;
		long upTime = timeNow - time; 
		
		int minutes = (int) (upTime / 60);
		int seconds = (int) (upTime % 60);
		
		return minutes + " minutes, " + seconds + " seconds";
	}
	
	public String getServerText() {
		int serverSize = shardManager.getGuilds().size();
		return "Watching " + serverSize + " Servers";
	}
	
	public String getCommandsText() {
		return this.mgr.getCommands().size() + " total commands";
	}
	
	public String getExecutedCommands() {
		String html = "<ul>";
		
		for(String cmdE : NoSkillv2.commandsExecuted) {
			html += "<li>" + cmdE + "</li>";
		}
		
		html += "</ul>";
		return html;
	}
	
	public void run() {
		try {
			ServerSocket serverSocket = new ServerSocket(port);
			
			Utils.log("Started web interface on port: " + port);
			
			while (true) {
				Socket clientSocket = serverSocket.accept();
				BufferedReader in = new BufferedReader(new InputStreamReader(clientSocket.getInputStream()));
				String s;
				while ((s = in.readLine()) != null) {
					if (s.isEmpty()) {
						break;
					}
				}
				OutputStream clientOutput = clientSocket.getOutputStream();
				clientOutput.write("HTTP/1.1 200 OK\r\n".getBytes());
				clientOutput.write("\r\n".getBytes());

				clientOutput.write(getContent().getBytes());

				clientOutput.write("\r\n\r\n".getBytes());
				clientOutput.flush();
				in.close();
				clientOutput.close();
			}
		} catch (Exception e) {
			Utils.log("Exception occurred on webserver thread");
		}
	}
	
	public String getContent() {
		return "<!DOCTYPE html>\r\n"
				+ "\r\n"
				+ "<head>\r\n"
				+ "	<link rel=\"preconnect\" href=\"https://fonts.googleapis.com\">\r\n"
				+ "	<link rel=\"preconnect\" href=\"https://fonts.gstatic.com\" crossorigin>\r\n"
				+ "	<link href=\"https://fonts.googleapis.com/css2?family=Roboto&display=swap\" rel=\"stylesheet\">\r\n"
				+ "<style>\r\n"
				+ "		ul {\r\n"
				+ "			counter-reset: index;  \r\n"
				+ "			padding: 0;\r\n"
				+ "		}\r\n"
				+ "  \r\n"
				+ "		li {\r\n"
				+ "			counter-increment: index; \r\n"
				+ "			display: flex;\r\n"
				+ "			align-items: center;\r\n"
				+ "			padding: 12px 0;\r\n"
				+ "			box-sizing: border-box;\r\n"
				+ "		}\r\n"
				+ "  \r\n"
				+ "		li::before {\r\n"
				+ "			margin-left: -10px;\r\n"
				+ "			content: \"> \";\r\n"
				+ "			font-size: 1.5rem;\r\n"
				+ "			text-align: right;\r\n"
				+ "			font-weight: bold;\r\n"
				+ "			min-width: 50px;\r\n"
				+ "			padding-right: 12px;\r\n"
				+ "			font-variant-numeric: tabular-nums;\r\n"
				+ "			align-self: flex-start;\r\n"
				+ "			background-image: linear-gradient(to bottom, aquamarine, orangered);\r\n"
				+ "			background-attachment: fixed;\r\n"
				+ "			background-clip: text;\r\n"
				+ "			-webkit-background-clip: text;\r\n"
				+ "			-webkit-text-fill-color: transparent;\r\n"
				+ "		}\r\n"
				+ "  \r\n"
				+ "		li + li {\r\n"
				+ "			border-top: 1px solid rgba(255,255,255,0.2);\r\n"
				+ "		}\r\n"
				+ "	</style>"
				+ "</head>\r\n"
				+ "\r\n"
				+ "<body style=\"font-family: 'Roboto', sans-serif; margin: 0; padding:0; background-color: #292929;\">\r\n"
				+ "	<div style=\"outline: 5px solid white; display: flex; justify-content: space-between; margin: 0; padding:0; height: 50px; background-color: #800080;\">\r\n"
				+ "		<div style=\"display: flex;\">\r\n"
				+ "			<img style=\"width: 50px; height: 50px;\" src=\""+ getBase64Logo() + "\" alt=\"Logo\" />\r\n"
				+ "			<h1 style=\"text-align: center; margin: 0; padding:5px; color: white;\">NoSkill v2 Web Interface</h1>\r\n"
				+ "		</div>\r\n"
				+ "		<h1 id=\"time\" style=\"margin: 0; padding:5px; color: white;\">NoSkill v2 Web Interface</h1>\r\n"
				+ "	</div>\r\n"
				+ "	\r\n"
				+ "	<div style=\"display: flex;margin: 15px; position: absolute;  left: 50%; top: 50%; -webkit-transform: translate(-50%, -50%); transform: translate(-50%, -50%);\">\r\n"
				+ "		<div style=\"margin: 50px; width: 500px;\">\r\n"
				+ "			<h2 style=\"color: white; text-align: center;\">- Bot Status -</h2>\r\n"
				+ "			<hr />\r\n"
				+ "			<h3 style=\"color: white;\"><span style=\"color: orange;\">[Servers]</span><br /><span id=\"serverText\"><span></h3>\r\n"
				+ "			<h3 style=\"color: white;\"><span style=\"color: orange;\">[Up Time]</span><br /><span id=\"uptimeText\"><span></h3>\r\n"
				+ "			<h3 style=\"color: white;\"><span style=\"color: orange;\">[Commands] </span><br /><span id=\"commandsText\"><span></h3>\r\n"
				+ "		</div>\r\n"
				+ "		\r\n"
				+ "		<div style=\"margin: 50px; width: 500px;\">\r\n"
				+ "			<h2 style=\"color: white; text-align: center;\">- Latest Executed Commands -</h2>\r\n"
				+ "			<hr />\r\n"
				+ getExecutedCommands()
				+ "		</div>\r\n"
				+ "	</div>\r\n"
				+ "	\r\n"
				+ "	<script>\r\n"
				+ "		function refreshText() {\r\n"
				+ "			const dateString = new Date().toLocaleString();\r\n"
				+ "			const formattedString = dateString.replace(\", \", \" - \");\r\n"
				+ "			\r\n"
				+ "			document.getElementById(\"time\").textContent = formattedString;\r\n"
				+ "			document.getElementById(\"serverText\").textContent = \"" + getServerText() + "\"\r\n"
				+ "			document.getElementById(\"uptimeText\").textContent = \"" + getUptimeText() + "\"\r\n"
				+ "			document.getElementById(\"commandsText\").textContent = \"" + getCommandsText() + "\"\r\n"
				+ "		}\r\n"
				+ "		\r\n"
				+ "		refreshText();\r\n"
				+ "		setInterval(refreshText, 1000);\r\n"
				+ "	</script>\r\n"
				+ "</body>\r\n"
				+ "\r\n"
				+ "</html>";
	}
}
